import React, { useEffect } from 'react';
import { initClient, signIn } from '../utils/auth';
import './Login.css';

const Login = () => {
    useEffect(() => {
        initClient();
    }, []);

    const handleLogin = async () => {
        await signIn();
        // Redirect or fetch user data after login
    };

    return (
        <div className="login-container">
            <h1>Login</h1>
            <button onClick={handleLogin}>Login with Google</button>
        </div>
    );
};

export default Login;
